import React from 'react';
import logo from './logo.svg';
import './App.css';

let array = []

function pupulateArray(num) {
  for(let i = 1; i < num; i++) {
    array.push(i)
  }
}
pupulateArray(600)
const grid = array.map(item => <div className={`div div${item}`}></div>)

export default class App extends React.Component {


  render() {
    return (
      <div className="App">
        {grid}
      </div>
    );
  }
}
